  false,\n\t\"url\": null,\n\t\"notes\": \"The Bureau of Reclamation operates a network
  of automated hydrologic and meteorologic monitoring stations (Hydromet) located
  throughout the Great Plains Region. The Hydromet network collects remote field data
  and transmits it via satellite to provide real-time water management capability.
  Hydromet data is then integrated with other sources of information to provide streamflow
  forecasting and current runoff conditions for river and reservoir operations.  This
  dataset includes the geographical locations of the sampling stations and associated
  parameters for data collection in each state within the Great Plains Region.\",\n\t\"license_title\":
